    false,nt"url": null,nt"notes": "This annual narrative report for Crosby
    Wetland Management District outlines District accomplishments during the 1976 calendar
    year. The report begins by describing the climate and habitat conditions in the
    District, as well as the land acquisition program, funding, and system status. The
    construction and maintenance section describes physical developments, maintenance,
    and wildfires. The habitat management section discusses croplands, grasslands, forest
    lands, wilderness and special areas, and easements for waterfowl management. Wildlife-
    including endangered and threatened species, migratory birds, big game animals,
    and raptors- are discussed. The public relations sections describes information
    and recreation, recreational uses, and enforcement. Field investigations, cooperative
    programs, items of interest, safety are discussed. Photographs and newspaper articles
    are attached.",nt"license_title": "License Not Specified",nt"extras":
